import React from "react";

const MatchupCard = ({ matchup }) => {
	return (
		<div className="col">
			<div className="matchup-card">
				<div className="matchup-card-header">
					<p>
						{matchup.time} {matchup.date}
					</p>
				</div>
				<div className="teams">
					<div className="team">
						<img src="../img/Atlanta.png" alt="Team Logo"></img>
						<p>{matchup.team_1.short_name}</p>
					</div>
					<p>@</p>
					<div className="team">
						<img src="../img/Boston.png" alt="Team Logo"></img>
						<p>{matchup.team_2.short_name}</p>
					</div>
				</div>
				<div className="bet-preview">
					<p>$10 $20 $30 $40 $50</p>
				</div>
				<button>View Odds</button>
			</div>
		</div>
	);
};

export default MatchupCard;
